import React from "react";

const SingleProduct = ({ product }) => {
  return (
    <Grid item xs={3}>
      <h2>{product.name}</h2>
      <p>{product.price}</p>
      <p>{product.color}</p>
      <hr />
    </Grid>
  );
};

export default SingleProduct;
